import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      monsters: [

        {name:"Frankestine"},
        {name:"Dracula"},
        {name:"Zombie"}

      ]
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App  -header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <p>
            {this.state.string}
          </p>
          <button onClick={ () => this.setState({string: "Hello, Atharva"}) } >Change Text</button>
          <br />
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

